import Head from 'next/head';

import { Jumbotron, Container } from 'reactstrap';
import Menu from '../components/Menu';
import Rodape from '../components/Rodape';

import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fas } from '@fortawesome/free-solid-svg-icons';

library.add(fas)


function Empresa({ data }) {
  return (
    <>
    <Head>
      <title>Sobre Empresa </title>
      <meta name="description" content="Sobre a empresa..." />
      <meta name="author" content="Luciano Valente" />
    </Head>
    
    <Menu />

    <Jumbotron fluid className="descr-top">
      <style>
        {`.descr-top{
          background-color: #000;
          color: #fed136;
          padding-top: 100px;
          padding-bottom: 50;
          margin-bottom: 0rem !important;
        }`}
      </style>
      <Container className="text-center">
        <h1 className="display-4">Sobre Empresa</h1>
      </Container>
    </Jumbotron>
    
    <Jumbotron>
      <Container className="sobre-empresa">
        <style>
          {`.sobre-empresa{
            background-color: #FFF;
            pad
          }`}
        </style>
        <div>
          <h2 className="display-4">Título</h2>
          <p className="lead pb-4">Subtítulo</p>
        </div>
      </Container>
    </Jumbotron>

    </>
  );
}

export default Empresa;
